import React from 'react';
import { useQuery } from '@apollo/client';
import  Pokemon  from './Pokemon';
import { GET_POKEMONS } from './graphql/graphqlScript';

function Pokemons() {
  const { loading, error, data } = useQuery(GET_POKEMONS); //Execute get pokemons list

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error :(</p>;
  console.log(data);

  return data.pokemons.results.map((currentPokemon) => ( //For every pokemon in the list
    <Pokemon pokemon={currentPokemon} key={currentPokemon.url}/> //Output Pokemon object
  ));

}

export default Pokemons;
